import React, { Component } from "react"
import './css/header.css'

class Header extends Component {
    render() {
        return (
            <div style={divStyle}>
                <img style={imgStyle} src="./img/Vector.png" />
                <div style={userStyle}>
                    <div style={manStyle}>
                        <img src="./img/XMLID_792_.png" />
                        <img src="./img/XMLID_795_.png" />
                    </div>
                    <div style={nameStyle}>{this.props.name}</div>
                </div>
            </div>
        )
    }
};

export default Header;
